function Body() {
    return ( 
        <div class="container overflow-hidden">
            <div class="row gx-5">
            <div class="col">
            <div class="p-3 border bg-light">Custom column padding</div>
            </div>
            <div class="col">
                <div class="p-3 border bg-light">Custom column padding</div>
            </div>
            </div>
        </div>
    );
  }
  
  export default Body
